import styles from "./Profile.module.scss";

const Profile = () => {
	const codecs = [
		"264",
		"264",
		"ISO",
		"265",
		"DVD",
		"H265",
		"SDTV",
		"WEBDL",
		"WEB 1080p",
	];
	const codecs2 = ["264"];

	return (
		<div className={styles.profile}>
			<div className={styles.header}>Any</div>
			<div className={styles.codecs}>
				{codecs.map((codec: any) => (
					<div className={styles.codec}>{codec}</div>
				))}
				{codecs2.map((codec: any) => (
					<div className={styles.codec}>{codec}</div>
				))}
			</div>
		</div>
	);
};
export default Profile;
